import { useState } from 'react';
import './App.css';


function App() {

const [book,setbook]=useState(13)


function bookchange(value) {
  setbook(book+value)
}


  return (
    <div className="App">
   {/* this is for book */}
  <div className="items">
    <span>Books</span>
    <button className="addBook ">add book</button>
    <button className="remBook" onClick={bookchange(-1)}>remove book</button>
    <span className="totalBooks">{book}</span>
      </div>


<div className="items">
    <span>Pens</span>
    <button className="addPen">add pen</button>
    <button className="remPen">remove pen</button>
    <span className="totalPens">1</span>
</div>


<div className="items">
    <span>Notebooks</span>
    <button className="addNotebook">add notebook</button>
    <button className="remNotebook">remove notebook</button>
    <span className="totalNotebooks">1</span>
      </div> 


<div className="items">
    <span>Inkpens</span>
    <button className="addInkpen">add inkpen</button>
    <button className="remInkpen">remove inkpen</button>
    <span className="totalInkpens">1</span>
</div> 

<div className="total">1</div>
    </div>
  );
}

export default App;
